int get_ei_n(trieptr trie, unsigned char * bytes, int length, int startvalue,int bound, int startindex)
{  
	int counter=0;
	trieptr result;

	//char *old_string = bytes;	
	//
	int number_of_instruction = 0;
	int max_count = 0;
	int call_count = 0;
	
	counter = startindex;
	
	if (counter > length || counter < 0)
	{
		return max_count;
	}
	
	while (counter < length ){
		if (max_count >= bound)
		{
			return max_count;
		}
		
		result = searchtrie(trie,bytes+counter,length-counter);
		
		if (result==NULL)
		{
// 			printf("???\n");
			if(call_count > 0 && number_of_instruction > max_count){
				max_count = number_of_instruction;
			}		 
			counter++;
			call_count = 0;
			number_of_instruction = 0;
		}
		else
		{
			if(result->jump == 's')
			{
				call_count++;				
			}
//			printf("%d %s ",number_of_instruction, result->line);
    		counter=counter+getSkip(result);
			number_of_instruction++;
		} 
		
		if(call_count > 0 && number_of_instruction > max_count)
		{
			max_count = number_of_instruction;
		}
	}
	
	if(call_count > 0 && number_of_instruction > max_count)
	{
		max_count = number_of_instruction;
	}
	
//	printf("Size of command = %d bytes\n",counter);
//	printf("max Num of command = %i \n", max_count);
	
	return max_count;
}

